import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page to access sort controls
    await page.waitForSelector('a:has-text("Electronics")');
    await page.click('a:has-text("Electronics")');
    await page.waitForLoadState('networkidle');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Wait for sort controls to appear and apply price sort
    await page.waitForSelector('#sortSelect');
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for products to re-sort
    await page.waitForTimeout(1000);
    await page.waitForLoadState('networkidle');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract data to verify sorting
    const productPrices = await page.$$eval('.product-price', prices => 
      prices.map(p => parseFloat(p.textContent.replace('$', '').trim()))
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) on Electronics category",
      extractedData: {
        productCount: productPrices.length,
        lowestPrice: Math.min(...productPrices),
        highestPrice: Math.max(...productPrices),
        isSorted: productPrices.every((price, i, arr) => i === 0 || price >= arr[i - 1])
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
